Parses.Sparql:
#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT  ?x
WHERE {
    {
      SELECT ?x (COUNT(?x) as ?count)
      WHERE {
          ns:m.02_p0 ns:sports.sports_award_type.winners ?y .
          ?y ns:sports.sports_award.award_winner ?x .
      }
    }
    {
      SELECT (MAX(?count) AS ?maxCount)
      WHERE {
        SELECT ?x (COUNT(?x) as ?count) 
        WHERE {
          ns:m.02_p0 ns:sports.sports_award_type.winners ?y .
          ?y ns:sports.sports_award.award_winner ?x .
        }
      }
    }
    FILTER (?maxCount = ?count)
}
